import { Box, useTheme } from '@mui/material';
import { FC } from 'react';

const Footer: FC = () => {
  const theme = useTheme();

  return (
    <Box
      alignSelf={'flex-end'}
      justifySelf={'flex-end'}
      justifyItems={'flex-end'}
      sx={{
        width: '100%',
        paddingY: 4,
        backgroundColor: theme.palette.primary.main,
      }}
    ></Box>
  );
};

export default Footer;
